float alpha = 1.;
vec4 color1 = vec4(1., 0.5, 0.5, 1.);
vec4 color2 = vec4(0.5, 0.2, 0.2, 1.);
void mainImage( out vec4 fragColor, in vec2 fragCoord ){
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = fragCoord/iResolution.xy;

    // Time varying pixel color
    vec3 col = 0.5 + 0.5*cos(iTime * 2.+uv.xyx);

    float grayValue = dot(col, vec3(0.2989,  0.5870, 0.1140));
    // Output to screen
    fragColor = mix(color2, color1, grayValue) * alpha;
}
